import express from 'express'
import morgan from 'morgan'
import pkg from '../../package.json'
import userRouter from '../routes/user.routes'
import roleRouter from '../routes/role.routes'
import authRouter from '../routes/auth.routes'


const app = express()

//Set global
app.set('pkg', pkg)

//ADD Middlewares to Server
app.use(morgan('dev'))
app.use(express.json())
//ADD Routes
app.get('/', (req, res) =>{
    res.json({
        autor: app.get('pkg').author,
        descripcion: app.get('pkg').description,
        version: app.get('pkg').version
    })
    console.log(app.get('pkg'))
});

//app.use('/v1/api/user', userRouter)
app.use('/v'+app.get('pkg').version+'/api/backend/user', userRouter)
app.use('/v'+app.get('pkg').version+'/api/backend/role', roleRouter)
app.use('/v'+app.get('pkg').version+'/api/backend/auth', authRouter)

export default app

